import './App.css';

function App() {
  return (
    <>
    <h1 className='bg-warning'>Hello World!</h1>
    <h2 className='text-danger'>Joy</h2>
    <p class="inter-regular">This is Regular (400) Inter font.</p>
  <p class="inter-semibold">This is SemiBold (600) Inter font.</p>
  <p class="inter-bold">This is Bold (700) Inter font.</p>
    </>
  );
}

export default App;
